//https://leetcode.com/problems/gas-station/
struct Solution;
struct SolutionBest;

impl SolutionBest {
    pub fn can_complete_circuit(gas: Vec<i32>, cost: Vec<i32>) -> i32 {
        let mut total_spent = 0;
        let mut tank = 0;
        let mut start_idx = 0;
        for i in 0..gas.len() {
            let spent = gas[i] - cost[i];
            tank += spent;
            total_spent += spent;
            if tank < 0 {
                start_idx = i + 1;
                tank = 0;
            }
        }
        if total_spent >= 0 {
            start_idx as i32
        } else {
            -1
        }
    }
}
use std::collections::BinaryHeap;
impl Solution {
    pub fn can_complete_circuit(gas: Vec<i32>, cost: Vec<i32>) -> i32 {
        println!("----");
        let mut index_maps = Vec::new();
        let mut start_indexes = BinaryHeap::new();
        let mut gas_and_cost = Vec::new();
        let mut new_i = 0 as usize;
        let mut rep = 1;
        for i in 0..gas.len() - 1 {
            if gas[i + 1] != gas[i] || cost[i + 1] != cost[i] {
                gas_and_cost.push((rep * gas[i], rep * cost[i]));
                println!(
                    "Gas and cost -> {rep} = {:?}",
                    (rep * gas[i], rep * cost[i])
                );
                if rep * (gas[i] - cost[i]) >= 0 {
                    println!("Push {:?}", (rep * cost[i], new_i));
                    start_indexes.push((rep * gas[i] - rep * cost[i], new_i));
                }
                index_maps.push(i - (rep - 1) as usize);
                new_i += 1;
                rep = 1;
            } else {
                rep += 1;
            }
        }
        gas_and_cost.push((rep * gas[gas.len() - 1], rep * cost[cost.len() - 1]));
        if rep * (gas[gas.len() - 1] - cost[cost.len() - 1]) >= 0 {
            println!(
                "A -> Push {:?} @{}",
                (rep * gas[gas.len() - 1] - rep * cost[cost.len() - 1], new_i),
                cost.len() - 1 - (rep - 1) as usize
            );
            start_indexes.push((rep * gas[gas.len() - 1] - rep * cost[cost.len() - 1], new_i));
            index_maps.push(cost.len() - 1 - (rep - 1) as usize);
        }
        let mut start_indexes: Vec<(i32, usize)> = start_indexes.into_sorted_vec();
        println!("{gas_and_cost:?}\n{index_maps:?}\n{start_indexes:?}");
        while let Some((c, start_idx)) = start_indexes.pop() {
            let mut fuel = 0;
            let mut reached = true;
            if c >= 0 {
                //println!("{start_idx}");
                for i in start_idx..start_idx + gas_and_cost.len() {
                    let idx = i % gas_and_cost.len();
                    fuel += gas_and_cost[idx].0;
                    println!(
                        "pos = {} {}, Fuel filled {} -> {fuel} -> next station cost -> {}",
                        idx,
                        gas_and_cost.len(),
                        gas_and_cost[idx].0,
                        gas_and_cost[idx].1
                    );
                    println!("{fuel} < {}", gas_and_cost[idx].1);
                    if fuel < gas_and_cost[idx].1 {
                        reached = false;
                        break;
                    }
                    fuel -= gas_and_cost[idx].1;
                    println!(
                        "pos = {} {}, Fuel spent  {} -> {fuel}",
                        idx,
                        gas_and_cost.len(),
                        gas_and_cost[idx].1
                    );
                }
            }
            println!("{start_idx} -> {reached} ");
            if reached {
                return index_maps[start_idx] as i32;
            }
        }
        -1
    }
}

